import React, {useState} from "react";
import {BrowserRouter} from "react-router-dom";
import {Button, Input, Card, Table, PageHeader, Modal} from "antd";
import BraftEditor from "braft-editor"; // 引入富文本编辑器
import "braft-editor/dist/index.css"; // 引入css样式

const Case = function (props) {
    const [isAdd, setIsAdd] = useState(false); // 记录是否是添加页面
    const [backVisiable, setBackVisiable] = useState(false);

    const back = () => {
        return (
            <div>

            </div>
        )
    }

    const casePage = () => { // 显示案例
        return (
            <div>
                <Input.Group compact>
                    <Input style={{width: "200px"}} placeholder={"请输入案例名称"}/>&nbsp;&nbsp;&nbsp;
                    <Button type={"primary"}>搜索</Button>&nbsp;&nbsp;&nbsp;
                    <Button type={"primary"} onClick={() => {
                        setIsAdd(true);
                    }}>添加</Button>
                </Input.Group>
                <Table style={{marginTop: "20px"}}></Table>
            </div>
        )
    }

    const addPage = () => { // 添加案例
        return (
            <div>
                <PageHeader className={"site-page-header"} onBack={() => setBackVisiable(true)} title={"编辑案例"}>
                    <Input/>
                    <BraftEditor/>
                </PageHeader>
            </div>
        )
    }

    return (
        <BrowserRouter>
            <div style={{padding: "30px 20px"}}>
                {isAdd ? addPage() : casePage()}

                {/*<div style={{marginTop: "20px"}}>*/}
                {/*    {*/}
                {/*        <Card hoverable>*/}

                {/*        </Card>*/}
                {/*    }*/}
                {/*</div>*/}
                <Modal title={"警告"} visible={backVisiable} onCancel={() => {
                    setBackVisiable(false);
                }}>
                    <p>您的文章将不会被保存</p>
                </Modal>
            </div>
        </BrowserRouter>
    )
}

export default Case;
